words = {'best','my words lol dsdjahdagts'}
print(words)

enwords = set()
dewords = set()


for word in words:
   enctex = rsa.encrypt(word.encode('utf-8'), pubkey)
   enwords.add(enctex)
print(enwords)

for word in enwords:
    dectex = rsa.decrypt(word, privkey).decode('utf8')
    dewords.add(dectex)
